    false,nt"url": null,nt"notes": "Automatic Identification Systems (AIS)
    are a navigation safety device that transmits and monitors the location and characteristics
    of many vessels in U.S. and international waters in real-time. In the U.S. the Coast
    Guard and industry collect AIS data, which can also be used for a variety of coastal
    planning purposes. NOAA and BOEM have worked jointly to re-task and make available
    some of the most important records from the U.S. Coast Guard's national network
    of AIS receivers. Information such as location, time, ship type, length, width,
    and draft have been extracted from the raw data and prepared as track lines for
    analyses in desktop GIS software.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
